import '../App.css';
import NavBar from '../NavBar';
import DoubleInput from '../formComponents/DoubleInput';
import Input from '../formComponents/Input';

const Form = () => {
    return(
        <div>
            <NavBar />
            <p className='welcome'>Make an Account!</p>
            <fieldset>
                <DoubleInput />
                <Input title={"School Email"} sample={"astronomy@stu.npemm.org"} name={"email"} type={"email"}/>
            </fieldset>
        </div>
    )
}

export default Form;
